using System.ComponentModel.DataAnnotations;

namespace ClinicaAPI.Models
{
    public class ColaboradorModel
    {
        [Key]
        public int Id { get; set; }
        public string Nome { get; set; }//
        public string Foto { get; set; } = "data:image/jpeg;base64,";
        public DateTime DtNasc { get; set; }
        public string RG { get; set; }
        public string CPF { get; set; }//
        public string Endereco { get; set; }
        public string? TelFixo { get; set; }
        public string? Celular { get; set; }//
        public string Email { get; set; }
        public DateTime DtAdmis { get; set; } = DateTime.Now.ToLocalTime();
        public DateTime DtDeslig { get; set; }
        public int IdPerfil { get; set; }
        public bool Ativo { get; set; } = true;//
        public string? AreaSession { get; set; }
        public string SenhaHash { get; set; }
        public string? senhaProv { get; set; }


    }
}
